import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import RestaurantOutlinedIcon from '@material-ui/icons/RestaurantOutlined';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';
import PeopleAltIcon from '@material-ui/icons/PeopleAlt';
import EmojiPeopleIcon from '@material-ui/icons/EmojiPeople';
import SupervisedUserCircleIcon from '@material-ui/icons/SupervisedUserCircle';
import FavoriteIcon from '@material-ui/icons/Favorite';
import { Avatar } from '@material-ui/core';
import { useSelector } from 'react-redux';
import { history } from '../../helpers/history';

const drawerWidth = 280;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: drawerWidth,
    zIndex: '-5!important',
  },
  drawerContainer: {
    overflow: 'auto',
  },
  '@global': {
    '.MuiDrawer-paperAnchorDockedLeft': {
      border: 'none'
    }
  }
}));

export function SideBar() {
  const classes = useStyles();
  const user = useSelector(state => state.authentication.user.data.user)
  return (
    <Drawer
      className={classes.drawer}
      variant="permanent"
      classes={{
        paper: classes.drawerPaper,
      }}
    >
      <Toolbar />
      <div className={classes.drawerContainer}>
        <List>
          <ListItem button>
            <ListItemIcon>
              <Avatar src={user ? user.photo : null}></Avatar>
            </ListItemIcon>
            <ListItemText primary={user.firstname + " " + user.lastname} />
          </ListItem>
          <Divider></Divider>
          <ListItem button>
            <ListItemIcon>
              <EmojiPeopleIcon style={{ color: 'blue' }}></EmojiPeopleIcon>
            </ListItemIcon>
            <ListItemText primary={"Bạn bè"} />
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <SupervisedUserCircleIcon color='primary'></SupervisedUserCircleIcon>
            </ListItemIcon>
            <ListItemText primary={"Nhóm"} />
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <FavoriteIcon style={{ color: 'red' }}></FavoriteIcon>
            </ListItemIcon>
            <ListItemText primary={"Yêu thích"} />
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <RestaurantOutlinedIcon style={{ color: 'green' }}></RestaurantOutlinedIcon>
            </ListItemIcon>
            <ListItemText primary={"Nhà hàng của tôi"} onClick={()=>history.push("/page")}/>
          </ListItem>
        </List>
      </div>
    </Drawer>
  );
}
